import IUnverifiedAccount from "../../../models/IUnverifiedAccount";

const UnverifiedAccountPTBR: IUnverifiedAccount = {
    title: "Conta não verificada",
    subTitle:
        "Identificamos que o e-mail {email} já possuí uma conta de usuário, mas o e-mail não foi verificado.",
    verifyNow: "Verifique agora, é rápido!",
    textBtn: "Verificar email",
};

export default UnverifiedAccountPTBR;
